l,\"suggestedName\":\"query13\",\"loading\":false,\"result\":{\"nameable\":true,\"columns\":[\"id\",\"data\"],\"values\":[[1,\"zip\"],[2,\"close\"],[3,\"winder\"]]}}]},{\"rowId\":\"rfth6a\",\"items\":[{\"query\":\"select * from j2;\",\"id\":\"s25hps\",\"error\":null,\"suggestedName\":\"query14\",\"loading\":false,\"result\":{\"nameable\":true,\"columns\":[\"id\",\"data\"],\"values\":[[1,\"sprat\"],[1,\"ball\"],[1,\"clip\"],[2,\"crepe\"],[3,\"three\"]]}}]},{\"rowId\":\"r05k0n\",\"items\":[{\"query\":\"A join on two tables, A and B, creates a duplicate of B concatenated to each row in A. Here is what that looks like in action.   \",\"id\":\"sfsjbv\",\"loading\":false,\"markdown\":true}]},{\"rowId\":\"rkqj2b\",\"items\":[{\"query\":\"select * from j1 join j2;\",\"id\":\"scie2f\",\"error\":null,\"suggestedName\":\"query15\",\"loading\":false,\"result\":{\"nameable\":true,\"columns\":[\"id\",\"data\",\"id\",\"data\"],\"values\":[[1,\"zip\",1,\"sprat\"],[1,\"zip\",1,\"ball\"],[1,\"zip\",1,\"clip\"],[1,\"zip\",2,\"crepe\"],[1,\"zip\",3,\"three\"],[2,\"close\",1,\"sprat\"],[2,\"close\",1,\"ball\"],[2,\"close\",1,\"clip\"],[2,\"close\",2,\"crepe\"],[2,\"close\",3,\"three\"],[3,\"winder\",1,\"sprat\"],[3,\"winder\",1,\"ball\"],[3,\"winder\",1,\"clip\"],[3,\"winder\",2,\"crepe\"],[3,\"winder\",3,\"three\"]]}}]},{\"rowId\":\"rsvz2x\",\"items\":[{\"query\":\"Typically what we would do though is join on a specific condition using the ON keyword. This filters out the results. In this example we have joined data in table j1 with j2 where the ids are the same. \",\"id\":\"sv5cx2\",\"loading\":false,\"markdown\":true}]},{\"rowId\":\"rzlesb\",\"items\":[{\"query\":\"select * from j1 join j2 on j1.id = j2.id;\",\"id\":\"skutpn\",\"error\":null,\"suggestedName\":\"query16\",\"loading\":false,\"result\":{\"nameable\":true,\"columns\":[\"id\",\"data\",\"id\",\"data\"],\"values\":[[1,\"zip\",1,\"ball\"],[1,\"zip\",1,\"clip\"],[1,\"zip\",1,\"sprat\"],[2,\"close\",2,\"crepe\"],[3,\"winder\",
